import React from 'react'

const Sidebtn = (props: any) => {
    return (
        <button className="">
            {props.text}
        </button>
    )
}


const SideBar = (props: any) => {
  return (
    <div className="absolute right-0 h-full w-3/4 bg-red-500">
        <h1>Title</h1>
    </div>
  )
}

export default SideBar
